import React from "react";
import styles from "./Headercss.module.css";



const Body = () => {
  return (
    <>
    <div className={styles.bodyofferbar}>
      <a src = '/' alt = '/'><h1>Assinar</h1></a>
    </div>
    </>
  );
};

export default Body;
